SET GLOBAL event_scheduler = ON;

DELIMITER $$

CREATE EVENT IF NOT EXISTS event_daily
    ON SCHEDULE
        EVERY 1 DAY
    DO
    BEGIN
        DELETE FROM publication WHERE UNIX_TIMESTAMP(`created`) < (UNIX_TIMESTAMP()-720*3600);
    END $$

DELIMITER ;

